// Implement routes by fetching from some API
import React, { useEffect } from "react";
import { connect } from "react-redux";
import { getRoutes } from "../../store/actions/routeActions";

const FindRoutes = ({ getRoutes }) => {
  // let route = fetch("https://api.myjson.com/bins/yqyge")
  //   .then(res => res.json())
  //   .then(data => {
  //     return JSON.stringify(data);
  //   });
  // console.log(route);
  useEffect(() => {
    getRoutes();
  });
  // console.log();
  return (
    <div className="container">
      <ul className="collection">
        <li className="collection-item">
          <div>
            <a href="#!">Listing listing test test</a>
            <br />
            <span className="grey-text">
              <span className="black-text">ID #1</span> last updated by{" "}
              <span className="black-text">Driver</span> on 01.19.2020
            </span>
            <a href="#!" className="secondary-content">
              <i className="material-icons grey-text">delete</i>
            </a>
          </div>
        </li>
        <li className="collection-item">
          <div>
            <a href="#!">Listing listing test test</a>
            <br />
            <span className="grey-text">
              <span className="black-text">ID #2</span> last updated by{" "}
              <span className="black-text">Driver</span> on 01.19.2020
            </span>
            <a href="#!" className="secondary-content">
              <i className="material-icons grey-text">delete</i>
            </a>
          </div>
        </li>
        <li className="collection-item">
          <div>
            <a href="#!">Listing listing test test</a>
            <br />
            <span className="grey-text">
              <span className="black-text">ID #3</span> last updated by{" "}
              <span className="black-text">Driver</span> on 01.19.2020
            </span>
            <a href="#!" className="secondary-content">
              <i className="material-icons grey-text">delete</i>
            </a>
          </div>
        </li>
        <li className="collection-item">
          <div>
            <a href="#!">Listing listing test test</a>
            <br />
            <span className="grey-text">
              <span className="black-text">ID #4</span> last updated by{" "}
              <span className="black-text">Driver</span> on 01.19.2020
            </span>
            <a href="#!" className="secondary-content">
              <i className="material-icons grey-text">delete</i>
            </a>
          </div>
        </li>
      </ul>
    </div>
  );
};

export default connect(null, { getRoutes })(FindRoutes);
